using namespace std;

typedef vector<int> vi;

class Solution {
public:
    char findTheDifference(string s, string t) {
        unordered_map<char, long long> us;
        long long k;

        for (char &i: s) {
            k = us[i];
            if (k == 0) us[i] = 1;
            else us[i] = k + 1;
        }

        for (char &ch: t) {
            if (us.find(ch) == us.end()) {
                return ch;
            } else {
                k = us[ch];
                us[ch] = k - 1;
            }


        }

        for (char &ch: t) {
            if (us[ch] == -1) {
                return ch;
            }
        }

        return 0;
    }
};

int main() {
    string s = "";
    string t = "";
    cout << Solution().findTheDifference(s, t);
    return 0;
}

